#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include "websocket_frame.h"

websocket_frame *websocket_frame_new( void ){
  return (struct _websocket_frame *) malloc( sizeof( struct _websocket_frame )) ;
}

void websocket_frame_set_length( websocket_frame *self, int length ){
  self->_length = length ;
}

void websocket_frame_set_opcode( websocket_frame *self, int opcode ){
  self->_opcode = opcode ;
}

void websocket_frame_set_mask( websocket_frame *self, int mask ){
  self->_mask = mask ;
}

void websocket_frame_set_data( websocket_frame *self, char *message ){
  self->_data = message ;
}

void websocket_frame_set_fin( websocket_frame *self, int fin ){
  self->_fin = fin ;
}

unsigned char *websocket_frame_as_string( websocket_frame *self, int *frame_size ){
  unsigned int b1, b2 ;
  unsigned long long data_len ;
  unsigned short b3 ;
  unsigned long long b4 ;
  unsigned char *result ;
  int len_len ;

  b1 = 0x80 | ( self->_opcode & 0x0f ) ;
  
  printf("First: 0x%x\n", b1) ;

  data_len = strlen( self->_data ) ;

  printf("LEN: %d\n", data_len) ;

  if ( data_len <= 125 ) {
    fprintf(stderr, "len less than 125\n") ;
    b2 = data_len ;
    len_len = 0 ;
  }
  else 
    if ( data_len > 125 && data_len < 65536 ){
      fprintf(stderr, "len less than 65536\n") ;
      b2 = 126 ;
      b3 = data_len ;
      len_len = 2 ;
    }
    else
      if ( data_len >= 65536 ){
        b2 = 127 ;
        b4 = data_len ;
        len_len = 8 ;
      }

  int alloc_len = 2 + len_len + data_len ;

  result = (unsigned char *) malloc( alloc_len );

  result[0] = b1 ;

  if ( data_len <= 125 ){
    result[1] = b2 ;
    strcpy( &result[2], self->_data ) ;
  }
  else 
    if ( data_len > 125 && data_len < 65536 ){
      result[1] = b2 ;
      result[2] = ((data_len >> 8) & 0xff ) ;
      result[3] = data_len & 0xff ;
      printf("first! 0x%02hhx\n", result[2]) ;
      printf("secx! 0x%02hhx\n", result[3]) ;

      strcpy( &result[4], self->_data ) ;
    }
    else{
      printf("BIG\n") ;
      result[1] = b2 ;
      result[2] = ((data_len >> 56) & 0xff ) ; ;
      result[3] = ((data_len >> 48) & 0xff ) ; ;
      result[4] = ((data_len >> 40) & 0xff ) ; ;
      result[5] = ((data_len >> 32) & 0xff ) ; ;
      result[6] = ((data_len >> 24) & 0xff ) ; ;
      result[7] = ((data_len >> 16) & 0xff ) ; ;
      result[8] = ((data_len >> 8) & 0xff ) ; ;
      result[9] = data_len & 0xff ;

      strcpy( &result[10], self->_data ) ;
    }

  /*printf("about to assign \n") ;
  frame_text = (unsigned char *) malloc( alloc_len ) ;

  int i ;

  for( i = 0 ; i <=alloc_len ; i++){
    frame_text[i] = result[i] ;
  }
  */

  printf("about to assign len %d\n", alloc_len) ;
  *frame_size = alloc_len ;

  return result ;
}

